'use client';

import { useEffect, useState } from 'react';
import { usePathname } from 'next/navigation';

export default function GlobalLoader() {
  const [loading, setLoading] = useState(true);
  const [isRouteChanging, setIsRouteChanging] = useState(false);
  const pathname = usePathname();

  // Initial load
  useEffect(() => {
    const timeout = setTimeout(() => {
      setLoading(false);
    }, 1000); // Adjust the delay if needed

    return () => clearTimeout(timeout);
  }, []);

  // Navigation change
  useEffect(() => {
    setIsRouteChanging(true);
    const timeout = setTimeout(() => {
      setIsRouteChanging(false);
    }, 500); // Delay after route change to hide loader

    return () => clearTimeout(timeout);
  }, [pathname]);

  if (loading || isRouteChanging) {
    return (
      <div className="fixed inset-0 z-[9999] flex items-center justify-center bg-gradient-to-br from-[rgba(1,50,32,0.9)] via-[rgba(0,20,10,0.7)] to-transparent
">
         <svg
          className="animate-spin-slow"
    xmlns="http://www.w3.org/2000/svg"
    xmlnsXlink="http://www.w3.org/1999/xlink"
    width="90"
    height="90"
    fill="none"
    viewBox="0 0 53 53"
  >
    <path fill="url(#pattern0_52_3212)" d="M0 0h52.429v52.429H0z"></path>
    <defs>
      <pattern
        id="pattern0_52_3212"
        width="1"
        height="1"
        patternContentUnits="objectBoundingBox"
      >
        <use xlinkHref="#image0_52_3212" transform="scale(.003)"></use>
      </pattern>
      <image
        xlinkHref="data:image/png;base64,"
        id="image0_52_3212"
        width="333"
        height="333"
        preserveAspectRatio="none"
      ></image>
    </defs>
  </svg>
      </div>
    );
  }

  return null;
}
